import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

const User = ({user}) => {
    return (
        <tr className="header">
            <td>
                {user.username}
            </td>
            <td>
                {user.first_name}
            </td>
            <td>
                {user.last_name}
            </td>
            <td>
                {user.email}
            </td>
        </tr>
    )
}

const UserList = ({users}) => {
    return (
        <div className="container">
            <hr/>
            <table className="header_info">
                <th>
                    User name
                </th>
                <th>
                    First name
                </th>
                <th>
                    Last name
                </th>
                <th>
                    Email
                </th>
                 {users.map((user_string) => <User user={user_string}/>)}
            </table>
            {/*{users.map((user_string) => <User user={user_string}/>)}*/}
        </div>
    )
}
export default UserList
